Een terrorist, die kennis heeft over nucleaire bommen die ergens in Amerika zullen afgaan, wordt ondervraagd door een FBI-agent 
en een 'black-ops'-ondervrager. Ze worden hierbij geconfronteerd met het dilemma welke methodes nog geoorloofd zijn en welke 
niet.
